package p20251201;
import java.util.*;
public class ifPractice02 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
	      Scanner sc = new Scanner(System.in);

	        int a = sc.nextInt();
	        int b = sc.nextInt();

	        if (a >= b){
	            System.out.println(1);
	        } else {
	            System.out.println(0);
	        }

	        if (a > b){
	            System.out.println(1);
	        } else {
	            System.out.println(0);
	        }
	        
	        if (a <= b){
	            System.out.println(1);
	        } else {
	            System.out.println(0);
	        }

	        if (a < b){
	            System.out.println(1);
	        } else {
	            System.out.println(0);
	        }
	        
	        if (a == b){
	            System.out.println(1);
	        } else {
	            System.out.println(0);
	        }

	        if (a != b){
	            System.out.println(1);
	        } else {
	            System.out.println(0);
	        }
	}

}
